    //                   clickedOption == i + 1 ? "checked" : null
    //                 }`}
    //                 key={i}
    //                 onClick={() => setClickedOption(i + 1)}
    //               >
    //                 {option}
    //               </button>
    //             );
    //           })}
    //         </div>
    //         <input
    //           type="button"
    //           value="Next"
    //           id="next-button"
    //           onClick={changeQuestion}
    //         />
    //       </>
    //     )}
    //   </div>
    // </div>
    <div class="content_wraper">
      <div class="logo">
        <div class="container">
          <a target="_blank" href="https://www.inboundacademy.in/">
            <img src="images/inbound-academy-logo.webp" alt="Logo" />
          </a>
        </div>
      </div>
      <div class="body_content">
        <div class="container">
          <div class="exam_wrap">
            <div class="exam_title">
              <h1>Salesforce Administrator Certification Practice Test</h1>
            </div>
            <div class="exam_time">
              Time Remaining: &nbsp;
              <strong>
                <span id="timer"></span>
              </strong>
            </div>
            <div class="exam_qustions">
              <div class="qus_nums">01 of 50.</div>
              <div class="qus_ans">
                <div class="qustion">{Question[currentQuestion].question}</div>
                <div class="qustion_mcqs">
                  <ul type="A">
                    <li>
                      <span>
                        <input type="radio" name="ans" id="ansA" />
                        <label for="ansA">
                          How many questions are on the Salesforce admin
                          certification exam?
                        </label>
                      </span>
                    </li>
                    <li>
                      <span>
                        <input type="radio" name="ans" id="ansB" />
